/**
 * 和 sum 方法类似，iteratee 参数会作用于数组中的每一个元素
 *
 * @param {Array<any>} array 要相加的数组
 * @param {any} iteratee 迭代器
 * @returns {number} 相加的和
 *
 * @example
 *
 * const objects = [{ 'n': 4 }, { 'n': 2 }, { 'n': 8 }, { 'n': 6 }]
 *
 * sumBy(objects, ({ n }) => n)
 * // => 20
 */
declare function sumBy(array: Array<any>, iteratee: any): number;
export default sumBy;
